import styled from "styled-components";
import Footer from "./footer";
import Navbar from "./header"
import Slider from "./slider"
 const WorkGrid = styled.div`
 padding:6%;

 .carotxt
 {font-size:3em;
text-align:center;
text-transform:capitalize;
margin-left:0;}


}
.service-card{
    display:grid;
    grid-template-columns:50% 50%;
    background-color:#1d1d1d;
    color:#f6f6f6;
    margin:0%;
    height:80%;;
    width:100%;;
}
.service-icon
{height:80%;
width:60%;
position:relative;
left:22%;
top:10%;}
 `
 const ServiceContainer =styled.div`
    position:relative; 
    left:-10%;
    display:grid;
    grid-template-columns: 50% 50%;
    grid-template-rows: 40%  40%  40%;
    grid-gap:1%;
    height:600px;
    width:100%;
    margin:8%;
    left-margin:0;
    .txt-container{
        padding:2%;
        position:relative;
        top:-8%;
        left:8%;
        font-family:"space grotesk";
    }
    .service-name{
        border:solid;
        padding:4%;
    }
    .service-desc
    {border:solid;
    padding:8%;}`;

